import React, { Component } from "react";
import Hero from "./components/hero";

class HeroList extends Component {
  state = {
    heroes: [{ heroName: "", imageURL: "" }]
  };

  render() {
    return <h1 className="text-center">Test</h1>;
  }
}

export default HeroList;
